let newItem = positive;

function configChart(data, newItem) {
  //   console.log(_apiItem);
  data.filter((item, idx) => {
    if (idx % 5 === 0) {
      console.log(item.newItem);
      //   console.log(item.positive);
      return item.newItem;
    }
  });

  //   passData.map(filt => {
